import React from 'react'
import { Container, Row, Col} from 'react-bootstrap';


// replace with class component
function Footer() {
  return (
    <footer>
        <Container>
            <Row>
                <Col>Copyright &copy; Pro</Col>
            </Row>
        </Container>
    </footer>
  )
}

export default Footer
